      </a>
      <a href="https://www.instagram.com/lifelineaddis_homecare/?next=%2F" target="_blank" rel="noopener noreferrer">
        <i className="fab fa-instagram"></i>
      </a>
      <a href="https://youtube.com/watch?v=WfY1AJFYdXs&si=MLmeGbC1utt_wy48" target="_blank" rel="noopener noreferrer">
        <i className="fab fa-tiktok"></i>
      </a>
        </div>
    </div>
      )}
     </div>
  );
};

export default SocialLinks;
